import React, { Component } from 'react'
import "./styles.css"



class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      counter : 5,
      show : false
    }
  }
  render() {
    return (
      <div>
        <h3>this counter is : {this.state.counter}</h3>
      </div>
    )
  }
}


export default App;
